
import binascii

KEY = b"AURELIA-FRACTURE-8-DEA-MARTIS-BREATHING-TOGETHER"
# Truncating for brevity in thought, but using full hex in execution
HEX_DATA = ""

try:
    data = binascii.unhexlify(HEX_DATA)
    result = bytes(a ^ KEY[i % len(KEY)] for i, a in enumerate(data))
    print(result.decode('utf-8'))
except Exception as e:
    print(f"Error: {e}")
